import React, { useState } from 'react';
import { useAuth } from '../../auth/useAuth';
import { useNavigate } from 'react-router-dom';

// Mapping lokasi ke jenis logbook sesuai instruksi user
const POS_LOGBOOK_MAP = {
  'Screening': {
    'PSCP': [
      'logbook harian',
      'logbook rotasi personel',
      'pemeriksaan manual',
      'penitipan senjata api selain penumpang',
      'logbook explosive detector',
    ],
    'Level 4': [
      'logbook harian',
      'logbook rotasi personel',
    ],
    'HBS': [
      'logbook harian',
    ],
    'SCP LAGs': [
      'logbook harian',
    ],
    'SCP Transit': [
      'logbook harian',
      'logbook rotasi personel',
    ],
    'SSCP': [
      'logbook harian',
      'logbook rotasi personel',
      'logbook explosive detector',
      'form pi',
      'penitipan senjata api selain penumpang',
    ],
    'OOG': [
      'logbook harian',
      'logbook rotasi personel',
      'form pi',
      'rekonsiliasi',
      'penitipan senjata api selain penumpang',
    ],
  },
  'Terminal Protection': {
    'Chief Terminal Protection': [
      'logbook harian',
      'kemajuan personel',
    ],
    'Ruang Tunggu': [
      'logbook sterilisasi ruang tunggu',
      'logbook harian',
    ],
    'Walking Patrol': [
      'logbook harian',
      'walking patrol terminal',
    ],
    'Mezzanine Domestik': [
      'logbook harian',
    ],
    'Kedatangan Domestik': [
      'logbook harian',
    ],
    'Akses Karyawan': [
      'logbook harian',
    ],
    'Building Protection': [
      'logbook harian',
    ],
    'CCTV': [
      'logbook harian',
      'logbook penggunaan smart door gate',
      'daily check panic button',
      'unattended baggage',
      'behavior form',
      'suspicious form',
      'data tracking cctv',
      'buku pengunjung cctv',
    ],
  },
  'Non-Terminal Protection': {
    'Main Gate': [
      'logbook harian',
      'logbook rotasi personel',
      'check list pemeriksaan random & unpredictable',
    ],
    'Chief Non-Termina': [
      'logbook harian',
      'kemajuan personel',
    ],
    'Patroli': [
      'logbook harian airside',
      'logbook harian landside',
      'check list patroli airside',
      'check list patroli landside',
      'logbook random',
    ],
    'Kargo': [
      'logbook harian kargo domestik',
      'logbook harian kargo international',
      'logbook ra',
    ],
    'Papa November': [
      'logbook harian',
      'walking patrol landside',
    ],
    'Pos Congot': [
      'logbook harian',
    ],
  },
};

function slugify(str) {
  return str.toLowerCase().replace(/[^a-z0-9 ]/g, '').replace(/\s+/g, '-');
}

const OfficerDashboard = () => {
  const { auth } = useAuth();
  const userPos = auth?.user?.pos;
  const lokasiMap = POS_LOGBOOK_MAP[userPos] || {};
  const lokasiList = Object.keys(lokasiMap);
  const [openDropdown, setOpenDropdown] = useState(null);
  const navigate = useNavigate();

  return (
    <div className="min-h-screen flex flex-col items-center justify-center bg-gray-50 fade-in px-2 sm:px-4">
      <div className="w-full max-w-4xl mx-auto mt-8 mb-4">
        <h2 className="text-2xl sm:text-3xl font-bold mb-2 text-center text-blue-900">Officer Dashboard</h2>
        <h3 className="text-base sm:text-lg font-medium mb-6 text-center text-gray-600">Pos: <span className="font-semibold text-blue-700">{userPos || '-'}</span></h3>
      </div>
      <div className="w-full max-w-4xl mx-auto">
        <div className="grid grid-cols-1 sm:grid-cols-2 md:grid-cols-3 gap-6">
          {lokasiList.length === 0 && <div className="col-span-full text-gray-400 text-center">Tidak ada lokasi untuk pos ini.</div>}
          {lokasiList.map(lokasi => (
            <div key={lokasi} className="relative w-full">
              <button
                onClick={() => setOpenDropdown(openDropdown === lokasi ? null : lokasi)}
                className={`w-full card bg-white rounded-xl shadow-lg p-6 flex flex-col items-center justify-center cursor-pointer border border-gray-200 hover:border-blue-500 focus:outline-none focus:ring-2 focus:ring-blue-300 transition-all duration-200 ${openDropdown === lokasi ? 'ring-2 ring-blue-300' : ''}`}
                style={{ minHeight: 110 }}
              >
                <span className="text-lg sm:text-xl font-semibold mb-2 text-gray-800 text-center break-words">{lokasi}</span>
                <span className="text-blue-600 text-xs sm:text-sm font-medium">Pilih Jenis Logbook</span>
              </button>
              {openDropdown === lokasi && (
                <div className="absolute left-0 right-0 mt-2 bg-white border border-blue-100 rounded-xl shadow-2xl p-2 z-20 animate-fade-in-up"
                  style={{ minWidth: '100%', maxWidth: 320 }}
                >
                  {lokasiMap[lokasi].map(jenis => (
                    <button
                      key={jenis}
                      onClick={() => { setOpenDropdown(null); navigate(`/form/${slugify(jenis)}`); }}
                      className="block w-full text-left px-4 py-3 my-1 rounded-lg hover:bg-blue-50 text-gray-700 font-medium text-sm transition-all duration-150 focus:outline-none focus:bg-blue-100"
                    >
                      {jenis}
                    </button>
                  ))}
                </div>
              )}
            </div>
          ))}
        </div>
      </div>
    </div>
  );
};

export default OfficerDashboard;
